(1, 'Etched Sapphire Cuff', '(This is an archive photo)\r\n$725\r\nThis 2-1/2" wide statement cuff boasts a soft blue/gray/green faceted sapphire', '9TDQGQP7G72YG', 'bracelet15_cuff_sapphire_ver_1_350.jpg', 'bracelet15_cuff_sapphire_ver_3_350.jpg', 'Etched Sapphire Cuff', '', 'bracelets', 0, 'true', 0, 1, '', '2016-11-18 06:48:47', 'hidden', 0, 'true', 0, ''),
(2, 'Aqua Earring', 'Large, faceted aqua marine set in oxidized sterling with 22K accents, on posts. 2 1/4" long. ', 'G38Y2W9US8JSE', 'earring15_aqua_200.jpg', 'earring15_aqua_face_350.jpg', 'Aqua Earrings', '', 'earrings', 265, 'true', 0, 19, '', '2016-03-02 10:05:21', 'hidden', 3, 'true', 0, ''),
(3, 'Large Etched Pattern Earring', 'Hand etched and hammered sterling with 22k gold accent earrings. Each pattern will be slightly different, but all the same shape and size. 2" long. Available on post only.  (Exchanges Only)\r\n\r\n', 'D5NXPVBQ368JS', 'earring15_metal_large_etched_350.jpg', 'earring15_metal_large_etched_face_350.jpg', 'Large Etched Pattern Earring', '', 'earrings', 165, 'true', 0, 8, '', '2016-05-06 11:25:40', 'hidden', 0, 'true', 0, ''),
(4, 'Triple Druzy Earring', 'Elegant sparkling natural color, quartz druzies set in sterling with solid 22k gold accents. 3" long on posts', 'S4MUSY4X5VGXG', 'earring15_druzy_tripple_brown_ver2_200.jpg', 'earring15_druzy_tripple_brown_face_350.jpg', 'Tripple Druzy Earring', '', 'earrings', 525, 'false', 0, 9, '', '2016-03-02 10:09:32', 'hidden', 0, 'true', 0, ''),
(5, 'Black Druzy Earring', 'Sparkling black druzy stones hang from a cupped sterling & 22k gold top, on pots. 2 long.', '7EKYX9DX2UB86', 'earring15_druzy_leaf_black_200.jpg', 'earring15_druzy_leaf_black_face_350.jpg', 'Black Druzy Earring', '', 'earrings', 265, 'true', 0, 21, '', '2016-03-02 10:05:25', 'hidden', 2, 'true', 0, ''),
(6, 'Golden Labradorite Miss Match Earring', 'This pair is sold, however we do have other stones similar to these. Please email me for more information.....Iridescent gold Labradorite set in sterling with 22k gold accents. 2" on posts.', 'F6AADZSVP2LGL', 'earring15_labradorite_gold_miss_matched_200.jpg', 'earring15_labradorite_gold_miss_matched_face_350.jpg', 'Golden Labradorite Miss Match Earring', '', 'earrings', 195, 'true', 0, 22, '', '2016-04-28 08:38:51', 'hidden', 0, 'true', 0, ''),
(7, 'White Druzy Earring', 'Sparkling white with black dots druzy stones hang from a cupped sterling & 22k gold top, on posts. 2" long. Sold Thank you. ', '', 'earring15_druzy_leaf_white_tri_200.jpg', 'earring15_druzy_leaf_white_tri_face_350.jpg', 'White Druzy Earring', '', 'earrings', 265, 'true', 0, 23, '', '2016-03-02 10:09:36', 'hidden', 0, 'true', 0, ''),
(8, 'Sonoran Sunrise Earring', 'This is the Chrysocolla part of the popular red and blue Sonoran Sunrise stone. They hang from a cupped sterling &22k gold top, on posts. 2" long', '', 'earring15_sanora_200.jpg', 'earring15_sanora_face_350.jpg', 'Sonoran Sunrise Earring', '', 'earrings', 225, 'true', 0, 20, '', '2016-03-02 10:09:28', 'hidden', 0, 'true', 0, ''),
(9, 'Double Sapphire Earrings', 'Faceted sapphires, gray and yellow ear drops on post. Sterling silver and 22 karot gold. (Approximately 2").', 'Z3ECPZQEZQZ3Y', 'earring15_shap_double_gray_sm_350.jpg', 'earring15_shap_double_gray_sm_face.jpg', 'Double Sapphire Earrings ', '', 'earrings', 195, 'true', 0, 10, '', '2016-03-02 10:05:38', 'hidden', 0, 'true', 0, ''),
(10, 'Oval Earrings', 'Light weight and full of movement! Dark oxydized sterling and 22K gold on French ear wires.(approx. as shown 2 3/4").', '7RN65Q5RSZG3L', 'earring15_metal_oval_200.jpg', 'earring15_metal_oval_face_350.jpg', 'Oval Earrings ', '', 'earrings', 195, 'false', 0, 2, '', '2016-11-25 07:52:30', 'hidden', 0, 'true', 0, ''),
(11, 'Purple Sapphire Earring', 'Unusual bi-color sapphires in tones of smoky gray with deep magenta areas. Set in oxidized sterling with 22k gold accents and top. 2 1/4" long on posts.', '6KFRTTC3QUWPL', 'earring15_shap_purple_200.jpg', 'earring15_shap_purple_crop_face_350.jpg', 'Purple Sapphire Earring', '', 'earrings', 325, 'true', 0, 11, '', '2016-03-02 10:09:17', 'hidden', 0, 'true', 0, ''),
(12, 'Pearl Drop Earring', 'Dark oxidized sterling with 22k accents and a white fresh water pearl. 2" long on french earwires.', 'NT9XQKPMYWJR6', 'earring15_pearl_drop_200.jpg', 'earring15_pearl_drop_face_350.jpg', 'Pearl Drop Earring', 'Pearl Drop Earring', 'earrings', 125, 'false', 0, 3, '', '2016-04-27 15:09:42', 'hidden', 0, 'true', 0, ''),
(13, 'Rutilated Quartz Earring', 'Beautiful faceted clear quartz with Black Tourmaline rutile set in sterling with ssk gold accent. 2 1/4" long on posts.', '4Y7W3TPA7MZBJ', 'earrings_quartz_rutilated_200.jpg', 'earrings_quartz_rutilated_face_350.jpg', 'Rutilated Quartz Earring', '', 'earrings', 195, 'true', 0, 12, '', '2016-03-02 10:09:22', 'hidden', 0, 'true', 0, ''),
(14, 'Large Open Cone Earrings', 'These light weight earrings are BOLD and very sculptural. Sterling silver, on posts (approx. as shown 2 1/2")', 'E9Q5YQH2GVV8J', 'earring_15_metal_cone_350.jpg', 'earring_15_metal_cone_face_350.jpg', 'Large Open Cone Earrings ', '', 'earrings', 165, 'true', 0, 4, '', '2016-05-06 11:25:55', 'hidden', 0, 'true', 0, ''),
(15, 'Blue Gray Sapphire Earring', 'Deep silver/gray faceted sapphires set in oxidized sterling with 22K accent and top. 2 1/4" long on posts.', 'VVRYKH86JFU2C', 'earring15_shap_bluegray_200.jpg', 'earring15_shap_bluegray_face_350.jpg', 'Blue Gray Sapphire Earring', '', 'earrings', 325, 'false', 0, 5, '', '2016-06-13 13:01:29', 'hidden', 0, 'true', 0, ''),
(16, 'Opal Earring', 'Light weight and full of movement! Dark oxydized sterling and 22K gold on French ear wires. (approx. lenth 2").<br /><br />This pair is sold, however we do have similiar stones. Please email me and I will send you image shots for new ones by email before they are put up for sale.', '', 'earring15_opal_leaf_opal_200.jpg', 'earring15_opal_leaf_opal_face_350.jpg', 'Opal Earring', '', 'earrings', 295, 'true', 0, 13, '', '2016-03-02 10:06:07', 'hidden', 1, 'true', 0, ''),
(17, 'Blue Labradorite Earring', 'Iridescent blue Labradorite set in sterling with 22k gold accents. 2" on posts.<br /><br />This pair is sold, however we do have similiar stones. Please email me and I will send you image shots for new ones by email before they are put up for sale.', '', 'earring15_labradorite_blue_miss_matched_200.jpg', 'earring15_labradorite_blue_miss_matched_face_350.jpg', 'Blue Labradorite Earring', '', 'earrings', 195, 'true', 0, 14, '', '2016-03-02 10:05:32', 'hidden', 0, 'true', 0, ''),
(18, 'Onyx Earring', 'High polished black onyx hang from a cupped sterling & 22k gold top, on posts. 2 long.', 'PG6QF8ABT5ZM4', 'earring15_druzy_leaf_black_tri_350.jpg', 'earring15_druzy_leaf_black_tri_face_350.jpg', 'Onyx Earring', '', 'earrings', 225, 'true', 0, 15, '', '2016-03-02 10:05:55', 'hidden', 0, 'true', 0, ''),
(19, 'Green Labradorite Miss Match Earring', 'Iridescent green/gold Labradorite set in sterling with 22k gold accents. 2" on posts.<br /><br />This pair is sold, however we do have similiar stones. Please email me and I will send you image shots for new ones by email before they are put up for sale.', '', 'earring15_labradorite_green_matched_200.jpg', 'earring15_labradorite_green_matched_face_350.jpg', 'Green Labradorite Miss Match Earring', '', 'earrings', 192, 'true', 0, 16, '', '2016-04-28 08:38:53', 'hidden', 0, 'true', 0, ''),
(20, 'Small Etch Pattern Earring', 'Sterling silver with a etched pattern, each pair will have a slightly different pattern, but the same shape and size. 2" long. Available on a post or French earwire. Please select. ', 'QXPM2PC62EZMC', 'earring15_small_etch_200.jpg', 'earring15_small_etch_face_350.jpg', 'Small Etch Pattern Earring', '', 'earrings', 95, 'false', 0, 1, '', '2016-11-25 07:53:53', 'hidden', 0, 'true', 0, ''),
(21, 'Purple Quartz Earring', 'Purple quartz set in sterling with 22K accents. 1 3/4" on posts.', 'W3PB8R8ZKM5TG', 'earring15_quartz_purple_200.jpg', 'earring15_quartz_purple_face_350.jpg', 'Purple Quartz Earring', '', 'earrings', 160, 'true', 0, 17, '', '2016-03-02 10:09:11', 'hidden', 0, 'true', 0, ''),
(22, 'Narrow Oval Earrings', 'For that elegant evening out...Light weight and full of movement! Dark oxydized sterling and 22K gold on posts. (approx. as shown 3 1/4")', 'MV3ZV2XAEY5YN', 'earring15_metal_oval_long_350.jpg', 'earring15_metal_oval_long_face_350.jpg', 'Narrow Oval Earrings ', '', 'earrings', 265, 'false', 0, 6, '', '2016-04-27 15:09:33', 'hidden', 0, 'true', 0, ''),
(23, 'Chrysoprase Earring', 'Pretty green chysoprase set in sterling with 22K accents. Note: the left-hand stone has a small area on top with some drusy encrusted in it?.it&#39;s not a hole, it&#39;s a naturally occurring drusy in the stone. 2" long on posts. ', 'YEM4FUZRE6N7L', 'earring15_chrysoprase_200.jpg', 'earring15_chrysoprase_face_350.jpg', 'Chrysoprase Earring', '', 'earrings', 165, 'true', 0, 18, '', '2016-11-18 06:49:19', 'hidden', 0, 'true', 0, ''),
(24, 'Statement Rectangle Earring', 'Long but light, these sterling and 22k gold on sterling earrings are 2 3/4" long on posts. ', 'JFBPGJAADBEMQ', 'earring15_metal_statement_rectangle_200.jpg', 'earring15_metal_statement_rectangle_face_350.jpg', 'Statement Rectangle Earring', '', 'earrings', 265, 'true', 0, 7, '', '2016-11-18 06:49:59', 'hidden', 0, 'true', 0, ''),
(25, 'Two Part Convertible Chain', 'Made up of two separate but connecting pieces.  Wear them  hooked together (as shown in photo #1) for a dramatic length of 40 inches - wear it with those long sweaters! In the second photo, the thick chain is doubled back and hooked into the toggle to make it  6" shorter and "chunk up" the look!in the photo you see them separated.....one as a mid length 24" chain, the other is a 16" choker. Wear them layered, looped or separate.....and the choker can work as a bracelet if it fits doubled around your wrist.....  Let your imagination play with this piece! (Exchanges Only)', '8L5K5LPDZB2DY', 'necklace_chain_2piece_350.jpg', 'necklace_chain_2piece_ver2_750_350.jpg', 'Two Part Convertible Chain', '', 'necklaces', 495, 'false', 0, 1, '', '2017-06-10 12:39:56', 'hidden', 0, 'true', 0, ''),
(26, 'Three Piece Accessory Chain', 'This unique hand made chain is sterling silver with 22K gold. The 7.5" removable sections makes it  versatile in that it can be worn complete as a 22.5 necklace, a 15" choker, a bracelet or a lariat. Note that the extra fourth part in the middle of the bottom left image is available for $165.00. (Exchanges Only)', 'ZJF9KVHJNG94S|3 Pieces $495.00 USD|4 Pieces $660.00 USD|Fourth Piece only $165.00 USD', 'necklace_chain_3pc_750.jpg', '', 'Three Piece Accessory Chain', '', 'necklaces', 495, 'false', 1, 3, '', '2017-06-10 12:39:52', 'hidden', 0, 'true', 0, ''),
(27, 'Riveted Choker Chain', 'This dramatic yet simple choker can be worn at the full length of 18" or shortened to 16".  Sterling Silver', 'FN4ZTQWBFJEZA', 'necklace_chain_rivet_750.jpg', '', 'Riveted Choker Chain', '', 'necklaces', 395, 'false', 0, 2, '', '2017-05-09 07:23:22', 'hidden', 0, 'true', 0, ''),
(28, 'Pearl Drop Pendant/Enhancer', 'Fresh water pearl enhancer, sterling silver and 22k gold accents, has a bail that can be opened to wear on either of my 2 or 3 part chains, or order it with a neck wire.  Please select 16" or 18" if ordering with a neck wire.', '67N9EAEDFARF6|Pendant Only $265.00 USD|Pendant with Chain $325.00 USD', 'necklace_chain_pearl_ver2_750.jpg', '', 'Pearl Drop Pendant/Enhancer', '', 'necklaces', 265, 'false', 0, 4, '', '2016-04-28 08:40:35', 'hidden', 0, 'true', 0, ''),
(29, 'Amethyst Druzy Necklace', 'Beautiful Amethyst druzy hangs from a 17" chain.  Sterling with 22k gold accents.', 'NJB483MTTMECL', 'necklace_chain_amhes_ver2_750.jpg', '', 'Amethyst Druzy Necklace', '', 'necklaces', 425, 'true', 0, 5, '', '2016-03-02 10:09:42', 'hidden', 1, 'true', 0, ''),
(30, 'White Gray Shappire with handmade chain', 'Subtle gray-white faceted sapphire hangs from a hand made chain of sterling with 22k gold accents.  The chain is 17" with a 2" drop for the sapphire.<br /><br />This pair is sold, however we do have similiar stones. Please email me and I will send you image shots for new ones by email before they are put up for sale.', 'X8VMFR2BN5KHQ', 'necklace_chain_shapphire_whitegray_750.jpg', '', 'White Gray Shappire with handmade chain', '', 'necklaces', 465, 'true', 0, 8, '', '2016-03-02 10:10:09', 'hidden', 0, 'true', 0, ''),
