(320, 'Hubei Turquoise Cuff Bracelet', 'This bold cuff has a beautiful large Hubei Turquoise stone sitting atop a sterling silver band that has a direct etched pattern made just for this bracelet, and 22K gold accents.  The cuff is 1-1/2" wide and will fit a wrist that measures 7 to 7-1/4"  (the band itself measures 6" with a one inch wide opening)  NOTE! PLEASE CHECK THE SECOND IMAGE THAT SHOWS THE SCALE OF THIS BRACELET ON MY WRIST.  Will accept refunds on this up to 5 days after receipt of item.', 'KQ8385KUK5J8J', 'IMG_9757_350.jpg', 'IMG_9935_350.jpg', '', '', 'bracelets', 645, 'true', 0, 0, '', '2018-02-26 16:42:38', 'hidden', 0, 'true', 0, ''),
(321, 'Wave Bangle', 'This is a striking, undulating wide bangle bracelet made from fine silver with 22k Gold accents. Fully hand hammered using raising stakes.  The outer surface has a black shinny patina to contrast the satin fine silver interior.  It measures 1-1/4" wide at its widest point, with an 8-1/8" interior circumference, and WILL FIT OVER A LARGE HAND.  Its goes over my hand that measures 8-1/2" around.  This is NOT SUITABLE FOR A SMALL HAND...BUT I can make you one in your size to order!  Contact me by email to discuss an order.  PLEASE SEE THE ALTERNATE VIEW TO SEE SCALE.  Will accept returns up to 5 days after receipt on this item.', 'SW57A6PT4N8DN', 'IMG_9939_350.jpg', 'IMG_9938_350.jpg', '', '', 'bracelets', 495, 'true', 1, 0, '', '2018-02-26 16:42:49', 'hidden', 0, 'true', 0, ''),
(322, 'Hinged Bangle Bracelet', 'This is a bold bangle constructed with many layers of sterling silver with 22K gold accents.  It measures 1-1/4" wide and has an 8-1/8" inside circumference. It has a sliding pin opening, but is large enough to slip on over an 8-1/2" hand without opening, or a larger hand/wrist by using the hinge option.  THIS IS NOT SUITABLE FOR A SMALL HAND / WRIST.   Will accept returns up to 5 days after receipt on this item.  PLEASE SEE THE ALTERNATE VIEW TO SEE SCALE.', 'GG64GRNJFKLB2', 'IMG_9929_350.jpg', 'IMG_9937_350.jpg', '', '', 'bracelets', 725, 'true', 0, 0, '', '2018-02-26 16:42:35', 'hidden', 0, 'true', 0, ''),
(323, 'Boulder Opal Ring', '(Ring size 8.5, cannot be sized) This Boulder opal, set in sterling and surrounded by a solid 22K gold frame, is adorned with a 3mm diamond tube set in 22K gold.  The band is 5mm sterling with a band of solid 22K gold soldered to it and is square in shape. The opal changes form purples to blue/green depending on the direction.  PLEASE SEE ALTERNATE VIEW FOR SCALE.  Returns accepted within 5 days of receipt.', '3X9QXXDG2A5WA', 'IMG_9700_350.jpg', 'IMG_9657_350.jpg', '', '', 'rings', 1500, 'true', 1, 0, '', '2018-02-26 16:45:17', 'hidden', 0, 'true', 0, ''),
(324, 'Spessarite Garnet Ring', '(Size 8+, can be made larger, not smaller) This is a fun mineral, a natural Spessarite Garnet crystal, set in solid 22K gold sitting on a 10mm wide oxidized sterling "wave" band with 22K gold accents on each side.  PLEASE SEE ALTERNATE VIEW FOR SCALE.  Will accept returns within 5 days of receipt.', 'L8B3HMRVZ8KC8', 'IMG_9708_350.jpg', 'IMG_9658_350.jpg', '', '', 'rings', 525, 'true', 0, 0, '', '2018-02-26 16:45:38', 'hidden', 0, 'true', 0, ''),
